            {/* EXPLORE NEW LIFE START */}
            <SectionUploadCV />
            {/* EXPLORE NEW LIFE END */}

            {/* TOP COMPANIES START */}
            <SectionTopCompanies />
            {/* TOP COMPANIES END */}
        </>
    )
}

export default AboutUsPage;
